[package]
name = "yew_icons"
authors = ["Finn Bear"]
license = "MIT"
version = "0.8.0"
edition = "2021"
repository = "https://github.com/finnbear/yew_icons/"
description = "Easily include a variety of SVG icons into your Yew app"
exclude = [
    "/bootstrap",
    "/feather",
    "/Font-Awesome",
    "/heroicons",
    "/octicons",
    "/lipis-flag-icons",
    "/lucide",
    "/simple-icons",
    "/docs",
    "/test-app",
]

[[bin]]
name = "generator"
path = "src/generator.rs"
required-features = ["generator"]

[dependencies]
yew = { version = "0.21", features = [
    "csr",
] } #git = "https://github.com/yewstack/yew"}
quote = { version = "1.0", optional = true }
convert_case = { version = "0.5", optional = true }
proc-macro2 = { version = "1.0", optional = true }
enum-iterator = { version = "0.7", optional = true }
regex = { version = "1", optional = true }
base64 = { version = "0.13", optional = true }

[dev-dependencies]
tokio = { version = "1", features = ["rt", "macros"] }

[features]
default = ["data_uri"]
data_uri = []
generator = ["quote", "convert_case", "proc-macro2", "regex", "base64"]
iterate_icon_id = ["enum-iterator"]
#testing = ["yew/ssr", "iterate_icon_id"]
